import React from "react";
import TabBlcok from "./TabBlcok";
import CardList from "./CardList";
import ContentBlockStyled from "./styled/ContentBlockStyled";

const ContentBlock = () => {
  return (
    <ContentBlockStyled>
      <div>
        <TabBlcok />
        <CardList />
      </div>
    </ContentBlockStyled>
  );
};

export default ContentBlock;
